import React from 'react';
import DragDropAnimation from './DragDropAnimation';

const AnimationSection = () => {
  return (
    <section className="bg-blue-100 py-16">
      <div className="container mx-auto text-center">
        <h2 className="text-3xl font-bold mb-4">Drag2Drop</h2>
        <p className="mb-8">
          Simply drag your pre-filled information and drop it into the corresponding fields on any job application form.
        </p>
        <DragDropAnimation />
      </div>
    </section>
  );
};

export default AnimationSection;
